   profile = "itemBox";
   if (currentPg == "home") home += " currentPg";
   return (
   <div className="header">
      <div className="leftItem"><div className={home}>Home</div></div>
      <div className="rightItems"><div className="itemBox">About</div></div>
      <div className="rightItems"><div className="itemBox">Contact</div></div>
      <div className="rightItems"><div className="loginRegBox">Login / Register</div></div>
      <div className="rightItems"><div className="itemBox">Profile</div></div>
   </div>
   )
}

export default Header;
